import './Form.css';

function FilterButton(props) {
  return (
    <button style={{marginLeft:"300px"}}
      type="button"
      aria-pressed={props.isPressed}
      onClick={() => props.setFilter(props.name)}
    >
      <span >Show</span>
      <span>{props.name}</span>
      <span > task</span>
    </button>
  );
}

export default FilterButton;
